column6:
Os registos que cumprem funções de gestão de âmbito organizacional devem ser considerados no quadro da função que suportam. Exemplos de exclusão:
Registo de doentes entrados num hospital deve ser considerado em "Prestação de cuidados de saúde/ Gestão de utentes" (700.10);
Registo de alunos inscritos num estabelecimento de ensino deve ser considerado em "Prestação de serviços de ensino e formação/ gestão do aluno/formando" (750.10);
Registo de pessoas no âmbito de operações de prevenção ou investigação criminal deve ser considerado em "Administração da Justiça/ Prevenção e investigação criminal" (600.10);
Registo de trabalhadores da Administração deve ser considerado em "Administração de relações de trabalho/ Gestão de relações individuais de trabalho" (250.20);
Registo de 'bens inventariáveis', ou registo de documentos (expediente geral, setorial, ou de matérias classificadas) deve ser considerado em "Administração de direitos, bens e serviços/ Identificação e caracterização de bens" (300.30);
Registo de dados técnico-científicos deve ser considerado em "Prestação de serviços técnicos e científicos, investigação e desenvolvimento/ Execução de serviços científicos e técnicos" (800.10);
Registo de contactos institucionais deve ser considerado em "Dinamização e comunicação institucional/ Execução de atividades de comunicação institucional" (900.20).

É de notar que nem todos os registos necessitam de ter uma instrução de processos para inscrição e/ou atualização de dados, podendo os serviços utilizar informação produzida no âmbito de outra função. Por exemplo:
O registo de entidades acreditadas para o exercício de determinada atividade é atualizado com base na decisão sobre pedidos de acreditação, os quais devem ser considerados em "Reconhecimentos e permissões/ Licenciamentos, certificações e outras autorizações" (450.10);
O registo de classificação de património é atualizado com base na instrução de propostas de classificação, as quais devem ser consideradas em "Reconhecimentos e permissões/ Classificação e declaração de interesse ou utilidade pública" (450.20);
A emissão de certidões de registos deve ser considerada em "Reconhecimentos e permissões/ Emissão de comprovativos de factos ou atos" (450.30).

column24:
Densidade informacional:
A informação não é recuperável noutro PN de conservação permanente, nomeadamente a relativa às impressões digitais e fotografia.
Complementaridade informacional com
PN 400.10.001 Registo de contribuintes;
PN 400.10.011 Registo de trabalhadores no sistema da Segurança Social;
PN 400.10.040 Registo nacional de utentes.

column21:
"Conjugação dos critérios:
- Legal: [Lei 5/2008], artº 26.º, Conservação de perfis de ADN e dados pessoais
"1 - Os perfis de ADN e os correspondentes dados pessoais são:
a) Conservados por tempo ilimitado, quando integrados no ficheiro que contém a informação relativa a amostras de voluntários, previsto na alínea a) do n.º 1 do artº 15.º, salvo no caso de o titular revogar, de modo expresso, o consentimento anteriormente realizado;
b) Conservados por tempo ilimitado, quando integrados no ficheiro previsto na alínea b) do n.º 1 do artº 15.º, sendo eliminados quando for obtida a identificação;
c) Conservados até que haja identificação, quando integrados no ficheiro previsto na alínea c) do n.º 1 do artº 15.º, relativo aos perfis de ADN, referentes a «amostras referência» de pessoas desaparecidas, bem como os relativos a amostras de parentes, salvo se os parentes pedirem expressamente para eliminar o seu perfil do ficheiro;
d) Eliminados, quando a amostra for identificada com o arguido, no termo do processo-crime ou no fim do prazo máximo de prescrição do procedimento criminal, previsto no Código Penal, quando integrados no ficheiro criado ao abrigo do disposto na alínea d) do n.º 1 do artº 15.º;
e) Eliminados, quando a amostra não for identificada com o arguido, passados 20 anos após a recolha, quando integrados no ficheiro criado ao abrigo do disposto na alínea d) do n.º 1 do artº 15;
f) Eliminados na mesma data em que se proceda ao cancelamento definitivo das respetivas decisões no registo criminal, quando integrados no ficheiro criado ao abrigo do disposto na alínea e) do n.º 1 do artº 15.º;
g) Eliminados 20 anos após a cessação das funções, quando integrados no ficheiro criado ao abrigo da alínea f) do n.º 1 do artº 15.º que contém a informação relativa a amostras dos profissionais.
2 - Nos casos previstos na alínea d) do número anterior, quando o termo do processo-crime conduza a uma condenação por crime doloso, com trânsito em julgado, em pena igual ou superior a 3 anos de prisão, o perfil de ADN e os respetivos dados pessoais, atualizados, transitam para o ficheiro previsto na alínea e) do n.º 1 do artº 15.º, de acordo com o disposto no artº 8.º""
- Utilidade administrativa
Prazo para aplicação do disposto no art. 26.º, da lei 5/2008"
